-left,search-bg-color,impressiontracker,clicktracker,searchurl', '<script type=\"text/javascript\">\r\n\r\n    var button = document.getElementById(\"xyz\"); \r\n    function search300x250() {\r\n\r\nvar text = document.getElementById(\"searchstyle\").value;\r\n\r\n }\r\n\r\n         var placeholder;\r\n         var fcolor;\r\n         var size;\r\n         var width;\r\n         var height;\r\n    \r\n         document.getElementById(\"placeholder-input\").addEventListener(\'keyup\',() => {\r\n            placeholder = document.getElementById(\"placeholder-input\").value; \r\n            document.getElementById(\"searchstyle\").setAttribute(\"placeholder\",placeholder);\r\n        })\r\n        document.getElementById(\"placeholder-color\").addEventListener(\'change\',() => {\r\n            fcolor = document.getElementById(\"placeholder-color\").value; \r\n            document.getElementById(\"searchstyle\").style.color =fcolor;\r\n        })\r\n        document.getElementById(\"placeholder-size\").addEventListener(\'keyup\',() => {\r\n            size = document.getElementById(\"placeholder-size\").value; \r\n            document.getElementById(\"searchstyle\").style.fontSize =size+\"px\";\r\n        })\r\n        document.getElementById(\"placeholder-width\").addEventListener(\'keyup\',() => {\r\n            width = document.getElementById(\"placeholder-width\").value; \r\n            document.getElementById(\"searchstyle\").style.width =width+\"px\";\r\n        })\r\n    \r\n        document.getElementById(\"placeholder-height\").addEventListener(\'keyup\',() => {\r\n            height = document.getElementById(\"placeholder-height\").value; \r\n            document.getElementById(\"searchstyle\").style.height= height+\"px\";\r\n        })\r\n    \r\n        document.getElementById(\"search-top\").addEventListener(\'keyup\',() => {\r\n            searchtop = document.getElementById(\"search-top\").value; \r\n            document.getElementById(\"searchbox\").style.top= searchtop+\"px\";\r\n        })\r\n    \r\n        document.getElementById(\"search-left\").addEventListener(\'keyup\',() => {\r\n            searchleft = document.getElementById(\"search-left\").value; \r\n            document.getElementById(\"searchbox\").style.left= searchleft+\"px\";\r\n        })\r\n    \r\n        document.getElementById(\"search-bg-color\").addEventListener(\'change\',() => {\r\n            searchbgcolor = document.getElementById(\"search-bg-color\").value; \r\n            console.log(searchbgcolor)\r\n            document.getElementById(\"searchbox\").style.backgroundColor= searchbgcolor;\r\n        })\r\n    </script>'),
