(46, 'carousel', '<script type=\"text/javascript\" src=\"https://cdnjs.cloudflare.com/ajax/libs/gsap/1.19.1/TweenMax.min.js\"></script>\r\n  <link rel=\"stylesheet\" href=\"https://unpkg.com/swiper/swiper-bundle.min.css\" />\r\n<script src=\"https://unpkg.com/swiper/swiper-bundle.min.js\"></script>\r\n<style>\r\n#dynadata300x250{\r\n        width: 300px;\r\n        height: 250px;\r\n        position: absolute;\r\n        left:0px;\r\n        top:0px;\r\n        user-select: none;\r\n        font-family:Ember;\r\n        cursor: pointer;\r\n        overflow: hidden;\r\n        box-sizing: border-box;\r\n        border:1px solid black;\r\n    }\r\n    .swiper-slide{\r\n       width:147px;\r\n       height: 196px;\r\n        cursor: pointer;\r\n      }\r\n\r\n    .swiper-3d, .swiper-3d.swiper-css-mode .swiper-wrapper {\r\n        perspective:600px;\r\n    }\r\n    .swiper-3d .swiper-slide-shadow {\r\n        background-color: rgba(0, 0, 0, 0);\r\n    }\r\n    \r\n    .mock{\r\n        position:absolute;top:13px;left:12px;width:119px;height:176px;border:2px solid black;border-radius:5px;\r\n    }\r\n    \r\n</style>\r\n\r\n<body>\r\n<a target=\'_blank\' id=\"clickurl\" href=\"\" style=\"width:300;height:250px;overflow:hidden\">\r\n<div id=\"dynadata300x250\">\r\n    <img id =\'bg\' style=\'position:absolute;top:0px;left:0px;width:300px\' src=\"https://s.hcurvecdn.com/marks/valentine/300x250/bg.png\">\r\n    <img id =\'copy1\' style=\'position:absolute;top:0px;left:0px;width:300px\' src=\"https://s.hcurvecdn.com/marks/valentine/300x250/copy1.png\">\r\n    <img id =\'copy2\' style=\'position:absolute;top:0px;left:0px;width:300px\' src=\"https://s.hcurvecdn.com/marks/valentine/300x250/copy2.png\">\r\n    <img id=\"logo\" style=\'position:absolute;top:0px;left:0px;width:300px\' src=\"https://s.hcurvecdn.com/marks/valentine/300x250/logo.png\">\r\n    <img id=\"cta\" style=\'position:absolute;top:0px;left:0px;width:300px\' src=\"https://s.hcurvecdn.com/marks/valentine/300x250/cta.png\">\r\n    \r\n    \r\n</div>\r\n<div id=\"swipe_style\" style=\"position:absolute;width:147px;height:197px;background-color:transparent;top:27px;left:5px;overflow:hidden;cursor:pointer\">\r\n    \r\n    <div id=\"swiper\" class=\"swiper mySwiper\">\r\n        <div class=\"swiper-wrapper\" id=\"swiper-wrapper\">\r\n            <div class=\"swiper-slide\">\r\n                <img class=\"mock st_card\" id=\"card1\" src=\"https://s.hcurvecdn.com/mnsauto/mnsautotest/ast/card1.webp\">\r\n            </div>\r\n            <div class=\"swiper-slide\">\r\n                <img class=\"mock st_card\" id=\"card2\" src=\"https://s.hcurvecdn.com/mnsauto/mnsautotest/ast/card2.webp\">\r\n            </div>\r\n            <div class=\"swiper-slide\">\r\n                <img class=\"mock st_card\" id=\"card3\" src=\"https://s.hcurvecdn.com/mnsauto/mnsautotest/ast/card3.webp\">\r\n            </div>\r\n         </div>\r\n    </div>\r\n</div>\r\n</a>\r\n</body>\r\n<script>\r\nvar swiper = new Swiper(\".mySwiper\", {\r\n    effect: \"swiper\",\r\n    allowSlideNext:true,\r\n    grabCursor:true,\r\n    autoplay : true,\r\n    loop:true\r\n});\r\nsetTimeout(stops, 27000);\r\nfunction stops(){\r\n    swiper.autoplay.stop();\r\n}\r\n</script>', '300x250', 'bg,logo,copy,card1,card2,card3', 'card_container_top,card_container_left,card_container_width,card_container_height,card_width,card_height', '<script>\r\n\r\ndocument.getElementById(\"card_container_top\").value = Number(document.getElementById(\"swipe_style\").style.top.replace(/px/g, \'\'));\r\ndocument.getElementById(\"card_container_left\").value = Number(document.getElementById(\"swipe_style\").style.left.replace(/px/g, \'\'));\r\ndocument.getElementById(\"card_container_width\").value = Number(document.getElementById(\"swipe_style\").style.width.replace(/px/g, \'\'));\r\ndocument.getElementById(\"card_container_height\").value = Number(document.getElementById(\"swipe_style\").style.height.replace(/px/g, \'\'));\r\nvar mocks = document.getElementsByClassName(\"mock\");\r\ndocument.getElementById(\"card_width\").value = Number(getComputedStyle(mocks[0]).width.replace(/px/g, \'\'));\r\ndocument.getElementById(\"card_height\").value = Number(getComputedStyle(mocks[0]).height.replace(/px/g, \'\'));\r\n\r\ndocument.getElementById(\"card_container_top\").addEventListener(\"keyup\",(e)=>{\r\n    document.getElementById(\"swipe_style\").style.top = e.target.value+\"px\";\r\n});\r\ndocument.getElementById(\"card_container_left\").addEventListener(\"keyup\",(e)=>{\r\n    document.getElementById(\"swipe_style\").style.left = e.target.value+\"px\";\r\n});\r\ndocument.getElementById(\"card_container_width\").addEventListener(\"keyup\",(e)=>{\r\n    document.getElementById(\"swipe_style\").style.width = e.target.value+\"px\";\r\n});\r\ndocument.getElementById(\"card_container_height\").addEventListener(\"keyup\",(e)=>{\r\n    document.getElementById(\"swipe_style\").style.height = e.target.value+\"px\";\r\n});\r\n\r\n\r\ndocument.getElementById(\"card_width\").addEventListener(\"keyup\",(e)=>{\r\n    var mock = document.getElementsByClassName(\"mock\")\r\n\r\n    for (let j = 0; j < mock.length; j++) {\r\n        mock[j].style.width = e.target.value+\"px\";  \r\n    }\r\n});\r\ndocument.getElementById(\"card_height\").addEventListener(\"keyup\",(e)=>{\r\n    var mock = document.getElementsByClassName(\"mock\")\r\n    for (let j = 0; j < mock.length; j++) {\r\n        mock[j].style.height = e.target.value+\"px\";  \r\n    }\r\n});\r\nsetTimeout(() => {\r\n        if(localStorage.getItem(\"card_ast\") != \"\"){\r\n        var cards_asset = JSON.parse(localStorage.getItem(\"card_ast\"));\r\n        if(cards_asset.length > 0){\r\n            let swipe_wrap = document.querySelector(\"#swiper-wrapper\");\r\n          \r\n            swipe_wrap.innerHTML = \"\";  for(i=0;i<cards_asset.length;i++){\r\n                swipe_wrap.innerHTML += `<div class=\"swiper-slide\">\r\n                    <img class=\"mock st_card\" id=\"card${i}\" src=\"https://s.hcurvecdn.com/${cards_asset[i]}\">\r\n                </div>`;\r\n            }\r\n            localStorage.setItem(\"card_ast\",\"\")\r\n        }\r\n        }\r\n    }, 1000);\r\n</script>'),
